import React, { Component } from "react";
import {Link} from "react-router-dom";
import { Row, Col, Card, Form, Icon, Input, Button, Checkbox } from "antd";
import 'bootstrap/dist/css/bootstrap.min.css';
import $ from 'jquery';
import Popper from 'popper.js';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import axios from "axios";
const FormItem = Form.Item;



const Host = "test";

class LoginForm extends Component {
  constructor(props) {
    super(props);
    this.state = {
    username: "",
    password: "",

    };

  }


  render() {

    return (
     <div class="signup-form">
    <form action="/examples/actions/confirmation.php" method="post">
     <FormItem>
                    {getFieldDecorator("firstname", {
                      rules: [
                        {
                          required: true,
                          message: "Please input your Firstname!"
                        }
                      ]
                    })(
                      <Input size="large"
                      prefix={ <Icon type="user" style={{ color: "rgba(0,0,0,.25)" }} />  }
                        placeholder="Firstname"
                      />
                    )}
                  </FormItem>

        <div class="form-group">
			<div class="row">
				<div class="col-xs-6"><input type="text" class="form-control"
				name="first_name" placeholder="First Name" required="required"/></div>
				<div class="col-xs-6"><input type="text" class="form-control"
				name="last_name" placeholder="Last Name" required="required"/></div>
			</div>
        </div>


    </form>

</div>
    );
  }
}


const WrappedLoginForm = Form.create()(LoginForm);

export default WrappedLoginForm;
